description:
Job Description

Le poste est à pourvoir en CDI dans la DSI du Siège International d’Ubisoft à Paris, et plus particulièrement au sein de l’équipe « EBS » dont le rôle est de créer les meilleurs outils pour les employés d’Ubisoft.
Vous travailleriez en binôme avec un autre développeur (qui a un profil plutôt backend) sur des projets de création d’applications et de services web en lien avec la Data.
Concrètement, vous seriez en relation avec une équipe de Data Scientists et de Data Analysts qui ont des besoins en termes d’outils ou d’applications maison : Ils fournissent l’algorithme, vous fournissez le design, l’UX et le développement de l’application.
L’objectif est de créer des outils les plus efficaces possibles pour permettre à nos spécialistes Data de réaliser des analyses poussées et des recommandations prédictives.
À ce titre, vos missions seront les suivantes :
Échanger avec les équipes Data afin de comprendre, cadrer leurs besoins et leur proposer les solutions techniques les plus adaptées ;
Créer et développer la partie Front-end des applications en partenariat avec votre binôme en charge du Back-End ;
Être garant de la performance et de la scalabilité du code Front-End ;
 Participer aux décisions concernant les features et l’architecture Front-end des applications ;
Être le référent Front-End des différentes équipes impliquées dans le projet.

Qualifications

Background
Diplôme supérieur en informatique ou équivalent ;
Expérience minimum de 4 ans en tant que développeur Front-End.
Compétences requises
Excellente maîtrise du triptyque JavaScript / HTML5 / CSS3 ;
Connaissance approfondie d’Angular (6+) ;
Être capable de travailler au sein d’une équipe agile ;
Volonté de réaliser des interfaces “pixel perfect“ ;
 Anglais courant.
Compétences bonus
Connaissance d’une ou plusieurs bibliothèques JS (Bootstrap, Kendo UI components, Ngx-Charts…) ;
Expérience du TDD et/ou connaissance des frameworks de test Mocha et Jasmine ;
Intérêt pour les jeux vidéo.
Additional Information

null

Il s’agit d’un poste de développeur Back end node.js pour un client final basé dans le centre de Paris. C’est une entreprise travaillant sur un logiciel révolutionnaire dans la monde de la médecine.
Missions du développeur Back-end node.js :
Vous participez à l’amélioration continue des architectures en place ;
Vous contribuez au développement des différentes features ;
Profil du développeur Back-end node.js :
Connaître et avoir de l’expérience sur Node.js ;
Vous appréciez travailler en équipe ;
En tant que vrai passionné, vous êtes ouvert concernant le choix des technos utilisées ;
Vous vous sentez concernés par les problématiques sociales ;
Vous accordez beaucoup d’importance à la qualité du code.
Type d'emploi : Temps plein, CDI
Expérience:
développeur back-end node.js h/f ou similaire: 1 an (Souhaité)

mission
Dans le cadre de la refonte de notre système informatique et dans un contexte de digitalisation de nos métiers, nous recherchons un développeur.
Directement rattaché à la direction de la transformation vous aurez à :
participer à la mise en œuvre d’un nouveau SI CRM et ERP ;
participer à la conception d’un portail web B2C innovant embarquant de l’IA ;
participer à chaque étape de notre projet de transformation digitale de notre entreprise ;
coordonner les métiers dès la phase d’expression des besoins ;
coordonner les tests d’acceptance ;
participer à l’élaboration du modèle de données et de la reprise finale ;
scoring de la base de données, segmentation et ciblages marketing pour accompagner la stratégie commerciale et marketing ;
organiser le maintien en condition opérationnel futur (maintenance évolutive) ;
réaliser les paramétrages fonctionnels de la solution future ;
créer des pages internet, site web, landing page pour accompagner la stratégie commerciale et marketing ;
proposer des solutions digitales innovantes en lien avec la stratégie de l’entreprise.
Votre
profil
Développeur spécialisé sur le paramétrage fonctionnel, le développement de pages Internet et de solution digitales.
Ecole d’ingénieur /Niveau Bac+5 ; organisé(e), curieux(se), motivé(e), force de proposition.
Un première expérience similaire serait un plus, néanmoins, vos facultés d’adaptation et votre autonomie seront déterminantes.
Nous vous
proposons
Rémunération fixe + rémunération variable.
Titres restaurants ; remboursement des frais de transport ; mutuelle/prévoyance et retraite sur complémentaire.
Postuler

Nous recrutons un développeur full stack NodeJs/ReactJs.
Il s’agit d’une société internationale qui s’est implantée en Europe et vient d’ouvrir un bureau à Paris. Ils interviendront sur le projet dans le domaine de l’assurance.
En tant que développeur full stack expérimenté, vous travaillerez en équipe avec les technologies NodeJs et ReactJs.
Profil du développeur full stack expérimenté NodeJs/ReactJs:
Avoir une expérience de 5 ans dont 2 ans en NodeJs et ReactJs;
De bonnes connaissances en OAuth et Docker sont nécessaires;
Si vous êtes à l’aise dans un environnement AWS cloud et avez de l'expérience en DevOps se serait un plus;
Une expérience en agile et en TDD est la bienvenue;
Vous maitrisez et avez de l'expérience en SQL ou NoSQL ainsi qu’en REST API developpement/integration;
Être familier avec les outils d’intégration continue;
Un niveau d’anglais technique écrit et oral est requis.
Type d'emploi : Temps plein, CDI
Expérience:
développeur full stack expérimenté nodejs/reactjs h/f ou similaire: 1 an (Souhaité)
